a recherche scientifique (CNRS)\n# Copyright (c) 2020-2022 Commissariat a l'\u00e9nergie atomique et aux \u00e9nergies alternatives (CEA)\n# Copyright (c) 2020-2022 Institut national de recherche en informatique et en automatique (Inria)\n# Copyright (c) 2020-2022 Universit\u00e9 Paris-Saclay\n# Copyright (c) 2020-2022 Universit\u00e9 de Versailles Saint-Quentin-en-Yvelines\n#\n# SPDX-License-Identifier: MIT\n#\n###################################################################################################\n\n# from deisa import Deisa\nfrom dask_interface import Deisa\nfrom dask.distributed import performance_report, wait\nimport os\nimport time\n\nos.environ[\"DASK_DISTRIBUTED__COMM__UCX__INFINIBAND\"] = \"True\"\n\n# Scheduler file name and configuration file\nscheduler_info = 'scheduler.json'\nconfig_file = 'config.yml'\n\n# Initialize Deisa\nDeisa = Deisa(scheduler_info, config_file)\n\n# Get client\nclient = Deisa.get_client()\n\n# either: Get data descriptor as a list of Deisa arrays object\narrays = Deisa.get_deisa_arrays()\n# or: Get data descriptor as a dict of Dask array\n# arrays = Deisa.get_dask_arrays()\n\n# Select data\ngt = arrays[\"global_t\"][...]\nprint(gt, flush=True)\n\n# Check contract\narrays.check_contract()\n\n\ndef Derivee(F, dx):\n    \"\"\"\n    First Derivative\n       Input: F        = function to be derivate\n              dx       = step of the variable for derivative\n       Output: dFdx = first derivative of F\n    \"\"\"\n    c0 = 2. / 3.\n    dFdx = c0 / dx * (F[3: - 1] - F[1: - 3] - (F[4:] - F[:- 4]) / 8.)\n    return dFdx\n\nstart = time.time()\n# py-bokeh is needed if you wanna see the perf report\nwith performance_report(filename=\"dask-report.html\"):\n\n    # Construct a lazy task graph\n    cpt = Derivee(gt, 1).mean()\n\n    # Submit the task graph to the scheduler\n    s = client.persist(cpt, release=True)\n\n    # Sign contract\n    arrays.validate_contract()\n    del gt\n    # Print the result, note that \"s\" is a future object, to get the result of the computation,\n    # we call `s.result()` to retreive it.\n    # Write the results\n    with open(\"results.log\", \"a\") as f:\n        f.write(str(client.compute(s).result()))\n\nprint(\"{:&lt;21}\".format(\"EST_ANALYTICS_TIME:\") + \"{:.5f}\".format(time.time()-start))\n\n\nprint(\"Done\", flush=True)\nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"format":"0.0b"},"id":"1364","type":"NumeralTickFormatter"},{"attributes":{"axis":{"id":"1084"},"coordinates":null,"group":null,"ticker":null,"visible":false},"id":"1087","type":"Grid"},{"attributes":{"child":{"id":"1039"},"title":"Scheduler Profile (administrative)"},"id":"1405","type":"Panel"},{"attributes":{"months":[0,4,8]},"id":"1331","type":"MonthsTicker"},{"attributes":{},"id":"1439","type":"AllLabels"},{"attributes":{"callback":null},"id":"1056","type":"TapTool"},{"attributes":{"axis":{"id":"1230"},"coordinates":null,"dimension":1,"group":null,"ticker":null},"id":"1233","type":"Grid"},{"attributes":{"child":{"id":"bk-task-stream-plot"},"title":"Task Stream"},"id":"1406","type":"Panel"},{"attributes":{"below":[{"id":"1259"}],"center":[{"id":"1262"},{"id":"1266"},{"id":"1280"}],"height":150,"left":[{"id":"1263"}],"renderers":[{"id":"1278"}],"sizing_mode":"stretch_both","title":{"id":"1250"},"toolbar":{"id":"1270"},"toolbar_location":"above","x_range":{"id":"1215"},"x_scale":{"id":"1255"},"y_range":{"id":"1253"},"y_scale":{"id":"1257"}},"id":"1249","subtype":"Figure","type":"Plot"},{"attributes":{"child":{"id":"bk-bandwidth-worker-plot"},"title":"Bandwidth (Workers)"},"id":"1407","type":"Panel"},{"attributes":{},"id":"1376","type":"LinearScale"},{"attributes":{"bottom":{"field":"bottom"},"fill_color":{"field":"color"},"hatch_color":{"field":"color"},"left":{"field":"left"},"line_width":{"value":2},"right":{"field":"right"},"top":{"field":"top"}},"id":"1031","type":"Quad"},{"attributes":{"num_minor_ticks":5,"tickers":[{"id":"1550"}
